IF NOT EXISTS(SELECT * FROM sys.databases WHERE name = 'Orders')
BEGIN
CREATE DATABASE [Orders]
END

GO
USE [Orders]
GO

SET NOCOUNT ON;
GO

drop table if exists orderlijnen;
drop table if exists orders;
drop table if exists klanten;
drop table if exists werknemers;
drop table if exists producten;
GO

create table klanten (
	id INT IDENTITY(1,1) PRIMARY KEY,
	bedrijf VARCHAR(50),
	plaats VARCHAR(50),
	postcode VARCHAR(50),
	land VARCHAR(50),
	telefoonnummer VARCHAR(50)
);

SET IDENTITY_INSERT klanten ON;
GO


SET IDENTITY_INSERT klanten OFF
GO

create table werknemers (
	id INT IDENTITY(1,1) PRIMARY KEY,
	voornaam VARCHAR(50),
	achternaam VARCHAR(50),
	functie VARCHAR(11),
	geboortedatum DATE,
	inDienst DATE,
	avatar VARCHAR(150),
);

SET IDENTITY_INSERT werknemers ON;
GO


SET IDENTITY_INSERT werknemers OFF;
GO

create table producten (
	id INT IDENTITY(1,1) PRIMARY KEY,
	naam VARCHAR(50),
	verpakking VARCHAR(7),
	prijs DECIMAL(5,2),
	voorraad INT
);

SET IDENTITY_INSERT producten ON;
GO


SET IDENTITY_INSERT producten OFF;
GO

create table orders (
	id INT IDENTITY(1,1) PRIMARY KEY,
	klantId INT,
	werknemerId INT,
	orderdatum DATE,
	verzendadres VARCHAR(50),
	verzendplaats VARCHAR(50),
	verzendpostcode VARCHAR(50),
	verzendland VARCHAR(50),
	CONSTRAINT FK_KlantOrder FOREIGN KEY (KlantId)
    REFERENCES Klanten(id),
	CONSTRAINT FK_KlantWerknemer FOREIGN KEY (WerknemerId)
    REFERENCES Werknemers(id)
);

SET IDENTITY_INSERT orders ON;
GO


SET IDENTITY_INSERT orders OFF
GO

create table orderlijnen (
	id INT IDENTITY(1,1) PRIMARY KEY,
	productId INT,
	orderId INT,
	CONSTRAINT FK_ProductOrderlijn FOREIGN KEY (productId) REFERENCES producten(id),
	CONSTRAINT FK_OrderOrderlijn FOREIGN KEY (orderId) REFERENCES orders(id)
);

SET IDENTITY_INSERT orderlijnen ON;
GO


SET IDENTITY_INSERT orderlijnen OFF;
GO